metadata.description:
There are many realms that have yet to be discovered. While tales have been written of their existence, there is zero proof and no reason to believe it as truth. Thankfully, this only makes them more digestible, and the journey will be 1000x more worth it when you make it to your destination.

These "visual drugs" are heavily inspired by the techniques utilized in Earthbound for the battle backgrounds. You can click or tap to show/hide the lore text at any time.

